const isPreviousTemplate = (state = false, action) => {
    switch (action.type) {
        case 'CLICKED_PREVIOUS_TEMPLATE':
            return state = true;
        case 'CLICKED_PREVIOUS_TEMPLATE2':
            return state = false;
        default: 
            return state = false;
    }
};

export default isPreviousTemplate;
